import './App.css';
import React from 'react';
import Search from './Search.js';
import UploadDoc from './UploadDoc.js';
import Doc from './Doc.js';

function App() {
  const [docs, updateDocs] = React.useState([]);

  const imageUploaded = (doc) => {
    var updatedDocs = [...docs]
    updatedDocs.push(doc)
    console.log(docs)
    updateDocs(updatedDocs)
    console.log(docs)
  }

  const setupDoc = (doc) => {
    <div className="docs_col">
      <Doc source={doc} key={doc.name}/>
    </div>
  }

  const displayDocs = () => {
    console.log("displaying docs")
    return docs.map(doc => setupDoc(doc));
  }

  return (
    <div className="App">
      <Search />
      <UploadDoc imageUploaded={imageUploaded}/>
      <div className="docs_row">
        {
          displayDocs()
        }
      </div>
    </div>
  );
}

export default App;
